import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const regions = [
  'United States',
  'Canada',
  'Europe',
  'Asia',
  'Australia',
];
const languages = [
  'English',
  'French',
  'Spanish',
  'German',
  'Chinese',
];

const SignupPage = () => {
  const [region, setRegion] = useState('');
  const [language, setLanguage] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    // Simulate next step
    setTimeout(() => {
      navigate('/');
    }, 1000);
  };

  return (
    <div style={{ minHeight: '100vh', background: '#fff', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
      <form onSubmit={handleSubmit} style={{ width: '100%', maxWidth: 420, margin: '0 auto', background: 'none', boxShadow: 'none', padding: 0 }}>
        <div style={{ marginBottom: 16, color: '#888', fontSize: 17, fontWeight: 500 }}>Step 1 of 3</div>
        <h1 style={{ fontSize: '2.2rem', fontWeight: 700, marginBottom: 28 }}>Create Account</h1>
        <label htmlFor="region" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>Region</label>
        <select id="region" value={region} onChange={e => setRegion(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#f5f5f5', color: region ? '#222' : '#888' }}>
          <option value="" disabled>Select Region</option>
          {regions.map(r => <option key={r} value={r}>{r}</option>)}
        </select>
        <label htmlFor="language" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block', color: '#bbb' }}>Language</label>
        <select id="language" value={language} onChange={e => setLanguage(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#f5f5f5', color: language ? '#222' : '#bbb' }}>
          <option value="" disabled>Select Language</option>
          {languages.map(l => <option key={l} value={l}>{l}</option>)}
        </select>
        <label htmlFor="firstName" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>First Name</label>
        <input id="firstName" type="text" value={firstName} onChange={e => setFirstName(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 24, background: '#fafafa' }} />
        <label htmlFor="lastName" style={{ fontWeight: 500, fontSize: 16, marginBottom: 8, display: 'block' }}>Last Name</label>
        <input id="lastName" type="text" value={lastName} onChange={e => setLastName(e.target.value)} required style={{ width: '100%', padding: '12px 16px', fontSize: 18, borderRadius: 6, border: '1px solid #ddd', marginBottom: 32, background: '#fafafa' }} />
        <div style={{ fontSize: 15, color: '#444', marginBottom: 32, lineHeight: 1.6 }}>
          By clicking 'Next', I understand and agree to Tesla's <a href="#" style={{ color: '#3957ff' }}>Privacy Notice</a> and <a href="#" style={{ color: '#3957ff' }}>Terms of Use</a> for creating a Tesla Account and I authorize Tesla to contact me for account management purposes via the contact information I provide. I understand calls or texts may use automatic or computer-assisted dialing or pre-recorded messages. Normal message and data rates apply.
        </div>
        <button type="submit" style={{ width: '100%', background: '#a3bffa', color: '#fff', fontWeight: 600, fontSize: 18, borderRadius: 6, padding: '14px 0', border: 'none', marginBottom: 8, cursor: 'pointer' }}>Next</button>
      </form>
    </div>
  );
};

export default SignupPage;
